import React, { Component } from 'react';
import './gradeEntry.css';

class GradeEntryTable extends Component {
    render() {

        const assignmentList = {
            title: "Introduction to Class",
            points: 10
        }


        return (
            <div className="table-responsive">
            <table className="table table-bordered table-hover">
              <thead>
                <tr>
                  <th className="cell" scope="col">{assignmentList.title}</th>
                  <th className="cell" scope="col">Last</th>
                  <th className="cell" scope="col">Handle</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <th scope="row"></th>
                  <td>Mark</td>
                  <td>Otto</td>
                  <td>@mdo</td>
                </tr>
                <tr>
                  <th scope="row">2</th>
                  <td>Jacob</td>
                  <td>Thornton</td>
                  <td>@fat</td>
                </tr>
              </tbody>
            </table>
            </div>
            
        );
    }
}

export default GradeEntryTable;
